from collections import Counter
from queue import PriorityQueue

def canReorderDoubled(arr):
    counter = Counter(arr)
    queue = PriorityQueue()
    for num in counter:
        queue.put((abs(num), num))
    while not queue.empty():
        num = queue.get()[1]
        if not counter[num]:
            continue
        if counter[2 * num] < counter[num]:
            return False
        counter[2 * num] = counter[2 * num] - counter[num]
        counter[num] = 0
    return False

